import { useState } from "react";

function Box({ getColor, setColor }) {
  function changecolor() {
    setColor("grey");
  }

  return (
    <div
      onClick={changecolor}
      style={{ background: getColor }}
      className="box a"
    >
      A
    </div>
  );
}

export default Box;
